%[text] # Periodic State Space manipulation
%[text] The toolBox defines the PhasorSS class, that uses PhasorArray to define Linear Periodic State space systemes. 
%[text] Two type of system can be defined using theses object : 
%[text] - T is fixed:  \
%[text]  $\\dot{x} = A(t) x + B(t) u \n\\\\\ny = C(t) x + D(t) u \n\\\\\nA(t) = \\sum\_{k=-m} ^{k=m}A\_k e^{jk\\frac{2\\pi}{T}t} \\quad  \\text{idem B(t), C(t), D(t)}$
%[text] - Varying frequency : \
%[text]  $\\dot{x} = A(\\theta) x + B(\\theta) u \n\\\\\ny = C(\\theta) x + D(\\theta) u \n\\\\\nA(\\theta) = \\sum\_{k=-m} ^{k=m}A\_k e^{jk\\theta} \\quad  \\text{idem B(\\theta), C(\\theta), D(\\theta)}\n\\\\\n\\theta = p(t,x,u)$
%[text] In both case the decomposition of state matrix is considered time invariant and described through their respective phasorArray
%[text] The usual function (step, lsim, intial...) are defined. 
%[text] Additionnaly, to simulate a periodic input defined by a phasor array U, stepu is defined. 
%[text] Similarly to classic ss, phasorSS supports 2D indexing to extract specific output/input sets. 
%[text] ## Basic exemple
T= 0.1; %s
nx = 3;
nu = 2 ;
ny = 3;
A = PhasorArray.randomPhasorArrayWithPole(3,[-15 -10 -5],T,'h',10).reduce(10) %[output:80f3b602]
figure %[output:9a8b5579]
plot(A.HmqNEig(40,T),'*') %[output:9a8b5579]
figure         %[output:2441719e]
plot(A,T,title='State Matrix') %[output:2441719e]

B = PhasorArray.random(nx,nu,5);
C = PhasorArray.random(ny,nx,5);

G = PhasorSS(A,B,C,[],T,"InputName",{'U','W'},'OutputName',{"z_1","z_2","z_3"}) %[output:253e47ff]
figure %[output:03918bc8]
G.plot() %[output:03918bc8]
%%
%[text] ## Simulation
figure %[output:87d5dab4]
initial(G,ones(3,1),20*T) %[output:3e3a1a47] %[output:87d5dab4]

figure %[output:53455d81]
% step(G,20*T)
%as of 2025, step is bugged, use [t,y] = step ... then plot, instead
[y,t]=step(G,20*T) %[output:35a83c2c] %[output:3fc3f53b] %[output:3d7b545d]
plot(t,sum(y,3)) %[output:53455d81]


%periodic input for W and U 
UW = PhasorArray.random(2,1,5) %[output:1d2f7b50]
figure %[output:9b093ce3]
plot(UW) %[output:9b093ce3]
figure %[output:839824dd]
[y,t]=stepu(G,20*T,UW) %[output:6d397bc8] %[output:9fae910a] %[output:1a855bf5]
%as of 2025, step is bugged, use [t,y] = step ... then plot, instead
plot(t,sum(y,3)) %[output:839824dd]

t = 0:T/100:20*T-T/100;
uw = [t*25-70;atan((t-4*T)/0.3)*30];
figure %[output:3e8f0b4b]
plot(t,uw) %[output:3e8f0b4b]
figure %[output:36ee3e93]
lsim(G,t,uw,ones(3,1)) %[output:512f0859] %[output:65fceffe] %[output:36ee3e93]
%%\

figure %[output:89f2ba5f]
[y,t]= impulse(G,20*T) %[output:6c4f9eb5] %[output:115366d3] %[output:02f54044]
plot(t,sum(y,3)) %[output:89f2ba5f]
%as of 2025, impulse is bugged, use [t,y] =  ... then plot, instead

